import React, { Component } from 'react';
import './App.css';
import ListMovie from './movie/ListMovie';
import { Route } from 'react-router-dom'

class App extends Component {
  render() {
    return (
      <Route
        path={`/`}
        component={ListMovie}>
      </Route>
    );
  }
}

export default App;
